import React,{Component} from '.react'
class Footer extends React.Component{
  constructor(props){
    super(props);
    this.state={
      name:'hai',
    };
  }
  render(){
    return(<>
    <div>{this.state}</div>
    </>);
  }
}
export default Footer;
